import jsPDF from "jspdf";
(function (jsPDFAPI) {
var font = '';
var callAddFont = function () {
this.addFileToVFS('comic-bold.ttf', font);
this.addFont('comic-bold.ttf', 'Comic Sans', 'bold');
};
jsPDFAPI.events.push(['addFonts', callAddFont])
 })(jsPDF.API);

